INSERT INTO `exercises` VALUES ('1', '“软件危机”是指( )', '计算机病毒的出现', '利用计算机进行经济犯罪活动', '软件开发和维护中出现的一系列问题', '人们过分迷恋计算机系统', 'C', '0');
INSERT INTO `exercises` VALUES ('2', 'DFD中的每个加工至少需要( )', '一个输入流', '一个输出流', '一个输入或输出流', '一个输入流和一个输出流', 'D', '0');
INSERT INTO `exercises` VALUES ('3', '为了提高模块的独立性，模块之间最好是( )', '控制耦合', '性能需求', '内容耦合', '数据耦合', 'D', '0');
INSERT INTO `exercises` VALUES ('4', '下面关于PDL语言不正确的说法是( )', 'PDL是描述处理过程怎么做', 'PDL是只描述加工做什么', 'PDL也称为伪码', 'PDL的外层语法应符合一般程序设计语言常用的语法规则', 'B', '0');
INSERT INTO `exercises` VALUES ('5', '详细设计与概要设计衔接的图形工具是( ) ', ' DFD图', '程序图', 'PAD图', 'SC图', 'D', '0');
INSERT INTO `exercises` VALUES ('6', '不适合作为数据处理与数据库应用的语言是( )', 'SQL', 'Cobol', '4GL', 'Lisp', 'D', '0');
INSERT INTO `exercises` VALUES ('7', '下列关于功能性注释不正确的说法是( )', '功能性注释嵌在源程序中，用于说明程序段或语句的功能以及数据的状态', '注释用来说明程序段，需要在每一行都要加注释', '可使用空行或缩进，以便很容易区分注释和程序', '修改程序也应修改注释', 'B', '0');
INSERT INTO `exercises` VALUES ('8', '下列关于效率的说法不正确的是( )', '效率是一个性能要求，其目标应该在需求分析时给出', '提高程序效率的根本途径在于选择良好的设计方法，数据结构与算法', '效率主要指处理机时间和存储器容量两个方面', '程序的效率与程序的简单性无关', 'D', '0');
INSERT INTO `exercises` VALUES ('9', '测试的关键问题是( )', '如何组织对软件的评审', '如何验证程序的正确性', '如何采用综合策略', '如何选择测试用例', 'D', '0');
INSERT INTO `exercises` VALUES ('10', '结构化维护与非结构化维护的主要区别在于( )', '软件是否结构化', '软件配置是否完整', '程序的完整性', '文档的完整性', 'D', '0');
INSERT INTO `exercises` VALUES ('11', '软件维护困难的主要原因是( )', '费用低', '人员少', '开发方法的缺陷', '得不到用户支持', 'C', '0');
INSERT INTO `exercises` VALUES ('12', '可维护性的特性中，相互矛盾的是( )', '可理解性与可测试性', '效率与可修改性', '可修改性和可理解性', '可理解性与可读性', 'B', '0');
INSERT INTO `exercises` VALUES ('13', '快速原型是利用原型辅助软件开发的一种新思想，它是在研究( )的方法和技术中产生的。', '需求阶段', '设计阶段', '测试阶段', '软件开发的各个阶段', 'A', '0');
INSERT INTO `exercises` VALUES ('14', '从目前情况来看，增量模型存在的主要问题是( )', '用户很难适应这种系统开发方法', '该方法的成功率很低', '缺乏丰富而强有力的软件工具和开发环境', '缺乏对开发过程中的问题和错误具有应付变化的机制', 'C', '0');
INSERT INTO `exercises` VALUES ('15', '下列有关软件工程的标准，属于行业标准的是( )', 'GB', 'DIN', 'ISO', 'IEEE', 'D', '0');
INSERT INTO `exercises` VALUES ('16', '下列文档与维护人员有关的有( )', '软件需求说明书', '项目开发计划', '概要设计说明书', '操作手册', 'C', '0');
INSERT INTO `exercises` VALUES ('17', '在屏蔽软件错误的冗错技术中，冗余附加件的构成包括( )', '关键程序和数据的冗余存储和调用', '为检测或纠正信息在运算或传输中的错误须外加的一部分信息', '检测、表决、切换、重构、纠错和复算的实现', '实现错误检测和错误恢复的程序', 'D', '0');
INSERT INTO `exercises` VALUES ('18', '( )是为了确保每个开发过程的质量，防止把软件差错传递到下一个过程而进行的工作。', '质量检测', '软件容错', '软件维护', '系统容错', 'A', '0');
INSERT INTO `exercises` VALUES ('19', '表示对象相互行为的模型是模型( )', '动态模型', '功能模型', '对象模型', '静态模型', 'A', '0');
INSERT INTO `exercises` VALUES ('20', 'CASE工具的表示集成是指CASE工具提供相同的( )', '编程环境', '用户界面', '过程模型', '硬件\r\n/\r\n操作系统', 'B', '0');
INSERT INTO `experiment` VALUES ('1', '实验1 问题域部分设计', '完善性维护一个已有的库存清单系统，新增一个能在每天送给采购员一份订货报表的功能。新增该功能共投资了5000元，系统维护后能及时订货，消除零件短缺问题，每年可节约2500元，若系统生存期为5年,年利率为5％,请计算：①.货币的时间价值；②纯收入991');
INSERT INTO `experiment` VALUES ('2', '实验2 人机交互部分的设计', '假设某软件生命周期为5年。现在投资20万，年利率为3％。从每一年年底收入5万元，请计算该项目的①.货币的时间价值；②投资回收期(保留小数点后两位)。');
INSERT INTO `experiment` VALUES ('3', '实验3 控制驱动部分的设计', '某计算机系统投入使用后，5年内每年可节省人民币 2O0O元，假设系统的投资额为5000元，年利率为 12％。试计算投资回收期和纯收入。(保留小数点后两位）。\r\n');
INSERT INTO `experiment` VALUES ('4', '实验4 数据接口部分的设计', '某计算机系统共投资了5.5万元，系统投入使用后每年可节约2万元，若系统生存期为4年,年利率为5％,请计算：①.货币的时间价值；②.投资回收期；③.纯收入。');
INSERT INTO `experiment` VALUES ('5', '实验5 定义对象间的关系', '画出下面用\r\nPDL\r\n写出的程序的\r\nPAD\r\n图。<br/>\r\n \r\nWHILE P DO<br/>  \r\n     IF A >O THEN A1 ELSE A2 ENDIF;<br/> \r\n     S1;<br/>  \r\n     IF B>0 THEN B1;<br/>  \r\n          WHILE C DO S2;<br/>S3 <br/>ENDWHILE;<br/> \r\n     ELSE B2 <br/>\r\n     ENDIF;<br/> \r\n     B3  \r\n     E');
INSERT INTO `experiment` VALUES ('6', '实验6 UML中的几种其他图(a)-包、顺序图', '请画出求1 + 3 + 5 +„+ n的PAD图。');
INSERT INTO `experiment` VALUES ('7', '实验7 UML中的几种其他图(b)', '请使用PAD图描述在数组A（1）～A（10）中找最大数的算法。');
INSERT INTO `experiment` VALUES ('8', '实验8 发现对象、定义对象', '某商场在“五一”期间，顾客购物时收费有4种情况：普通顾客一次购物累计少于100元，按A类标准费（不打折，一次购物累计多于或等于100元，按B类标准收费（打9折）；会员顾客一次购物累计少于1000元，按C类标准收费（打8折），一次购物累计等于或多于1000元，按D类标准收费7折）。请使用PAD图来设计收费算法。');
INSERT INTO `experiment` VALUES ('9', '实验9 定义对象的属性和操作', '请用判定表画出以下问题的行为逻辑：人们往往根据气情况决定出门时的行装；天气可能下雨，也可能不下雨；天气可能变冷，也可能不变冷。如果天气要下雨，出门时带上雨伞；如果天气变冷，出门时要穿上大衣。');
