INSERT INTO `teaching_programme` VALUES ('16', '2012年教学大纲', '《计算机基础》课程采用理论与实践结合的方法教学，其教学目的是：培养学生对信息技术的兴趣；掌握计算机的基本理论、基本操作；熟练掌握Office办公软件的基本操作技能；掌握网络基础知识，并会用Internet网检索信息、传输信息，培养信息的甄别、筛选的能力；培养应用信息技术改进分析问题及解决问题的观念及方法，提高分析问题、解决问题的能力。掌握应用信息技术改变学习方式的方法，提高学习效率。  《计算机基础》课程的教学任务：计算机的（软硬件）基本知识；Windows操作系统的基本操作；Word、Excel及PowerPoint；网络基础及Internet网的应用；常用软件简介。', '2012', '2018-01-06');
INSERT INTO `teaching_programme` VALUES ('17', '2013年教学大纲', '本课程是信息管理与信息系统专业入门课，是其它学科课程的基础。 教材特点：注重理论及应用。理论讲解部分，宜用典型实例验证，使抽象理论具体化；操作及技能部分，应注重要点及方法的演练，并用实例说明操作过程；综合应用与能力提高部分，宜用案例驱动，但案例的引用及设计应注重动态实用、难度适中，符合教育教学规律和大学生的认知发展规律。', '2013', '2018-01-08');
INSERT INTO `teaching_programme` VALUES ('29', '2014年教学大纲', '本课程应采用“现代教学法”教学。所谓“现代教学法”就是以计算机技术、多媒体技术及网络技术为主体的信息教育技术为手段，突破教学时空，转变教学观念，以人的全面发展和社会需求为导向；改变学习方式，改进学习方法，提高教学效率；体现教师的主导地位和学生的主体地位，以建构知识、培养能力和提升素质为核心的教学方法。现代教学方法将整个教学活动分为“课前、课堂教学和课后” （见图1）三个环节', '2014', '2018-01-14');
INSERT INTO `teaching_programme` VALUES ('32', '2015年教学大纲', '瀑布模型属于整体开发模型，它规定在开始下一个阶段的工作之前，必须完成前一阶段的所有细节。而增量模型属于非整体开发模型，它推迟某些阶段或所有阶段中的细节，从而较早的产生工作软件。 3. （1）按设计任务要求进行常会设计，尽量保证设计的正确 （2）对可能出现的错误分类，确定实现容错的范围 （3）按照“成本—效率”最优原则，选用某种冗余手段（结构，信息，时间） 来实现对各类错误的屏蔽 （4）分析或验证上述冗余结构的容错效果 4. （1）项目的应用领域； （2）软件开发的方法 （3）软件执行的环境 （4）算法和数据结构的复杂性 （5）软件开发人员的知识 ', '2015', '2018-01-18');
INSERT INTO `teaching_programme` VALUES ('34', '2016年教学大纲', '首先教师对学生“课前”自学情况进行检查和评价。教师应组织学生以自评、互评、讨论、你问我答等多种方式进行自学过程及自学方式的检查评价。这也使学生自学成果得到复习、巩固和提高，教师还要注意收集学生学习的反馈信息，以便不断完善教程内容。其次教师应把教学重心置于学生能力培养上，教师应按预定目标精心设计的教学案例，灵活运用启发、分析、引导、观察思考、讨论、演练、归纳总结、引伸等多种教学方法，对学生进行知识及能力的主动建构。最后教师应引导学生自定主题，设计出有个性的案例或作品，从而培养学生的创新能力。', '2016', '2018-01-21');
INSERT INTO `teaching_programme` VALUES ('35', '2017年教学大纲', '本课程是计算机应用的入门课程，教学内容以基础性、系统性、先进性和实用性为原则.  1．具备计算机科学的基本理论和基本常识；  2．具有微型计算机的基本常识；   3．掌握汉字编码的概念，熟练掌握一种Windows 2000下的汉字输入方法； 4．熟练使用Windows2000操作平台；   5．基本掌握Office 2000的主要软件Word 2000 、Excel 2000和PowerPoint 2000的使用方法。', '2017', '2018-01-21');
